  Bred = Datas[3].split("|");
  if (Datas[4]) Gear = Datas[4].split("|"); else Gear = [];
  Cash = parseInt(Datas[5]);
  TruckCap = parseInt(Datas[6]);
  StableCap = parseInt(Datas[7]);
  AllMaps = Datas[8].split("@");
